package leetcode_test

import (
	"fmt"
	"testing"

	"github.com/stretchr/testify/require"
	"gitlab.com/gjerry134679/leetcode"
)

func TestNumberOfWonderfulSubstrings(t *testing.T) {
	type testCase struct {
		word string
		want int64
	}

	tcs := []testCase{
		{
			word: "aba",
			want: 4,
		},
		{
			word: "aabb",
			want: 9,
		},
		{
			word: "he",
			want: 2,
		},
		{
			word: "ehaehcjjaafjdceac",
			want: 29,
		},
		{
			word: "",
			want: 42762841,
		},
	}

	q := leetcode.Q1915{}
	for i := range tcs {
		tc := tcs[i]
		sub := tc.word
		if len(sub) > 15 {
			sub = fmt.Sprintf(sub[:15]+"...(%d letters)", len(sub)-15)
		}

		t.Run(
			fmt.Sprintf("Case %d - %s", i+1, sub),
			func(t *testing.T) {
				t.Parallel()
				got := q.WonderfulSubstrings(tc.word)
				require.Equal(t, tc.want, got)
			},
		)
	}
}
